  false,\n\t\"url\": null,\n\t\"notes\": \"The Annual Appropriation Ordinance is the
  final City operating budget as approved by the City Council. It reflects the Cityu2019s
  operating budget at the beginning of the fiscal year on January 1, 2014.This dataset
  displays the positions and related salaries detailed in the budget as of January
  1. It is extracted from the personnel portion of the Appropriation Ordinance. The
  dataset presents the position titles (without names) and salaries described in the
  budget, but does not provide a reflection of the current city workforce with full
  names and salaries. Disclaimer: the u201cTotal Budgeted Unitsu201d column displays
  either A) the number of employees AND vacancies associated with a given position,
  or B) the number of budgeted units (ie. hours/months) for that position. u201cPosition
  Controlu201d determines whether Total Budgeted Units column will count employees
  and vacancies or hours/months. If a Position Control is 1, then employees and vacancies
  are displayed; if a Position Control is 0, then the total number of hours/months
  recorded is displayed. Owner: Budget and Management. Frequency: Data are updated
  annually. For information on the current city workforce, with names, positions and
  salaries, visit the \"Current Employee Names, Salaries, and Position Titles\" dataset:
  https://data.cityofchicago.org/id/xzkq-xp2w.\",\n\t\"license_title\": \"License
